const express = require("express");
const router = express.Router();

const pdfMake = require("../pdfmake/pdfmake");
const vfsFonts = require("../pdfmake/build/vfs_fonts");

pdfMake.vfs = vfsFonts.pdfMake.vfs;

router.post("/pdf", (req, res, next) => {
  //res.send('PDF');
  pdfMake.fonts = {
    Bree: {
      normal: "bree-serif.regular.ttf",
      bold: "bree-serif.regular.ttf",
      italics: "bree-serif.regular.ttf"
    },
    Avenir: {
      normal: "avenir-light.otf",
      bold: "avenir-light.otf",
      italics: "avenir-light.otf"
    }
  };

  // var pdfPrinter = new pdfMake(fonts);
  const list = req.body.name;
  const name = list.split(/[\n\r]+/);
  const date = req.body.date;
  const program = req.body.program;

  const docArr = [];
  for (var i = 0; i < name.length; i++) {
    var content = [
      {
        table: {
          widths: [210, 50, 210, 50],
          body: [[{ text: date, alignment: "center", style: "date" }]]
        },
        layout: "noBorders",
        absolutePosition: { x: 495, y: 465 },
        font: "Avenir"
        //with borders
        // absolutePosition: { x: 488, y: 460 }
      },
      i !== name.length - 1
        ? {
            table: {
              widths: [700, 80, 700, 80],
              body: [[{ text: name[i], alignment: "center", style: "name" }]]
            },
            layout: "noBorders",
            absolutePosition: { x: 68, y: 295 },
            font: "Bree",
            //with borders
            // absolutePosition: { x: 66, y: 300 }
            pageBreak: "after"
          }
        : {
            table: {
              widths: [700, 80, 700, 80],
              body: [[{ text: name[i], alignment: "center", style: "name" }]]
            },
            layout: "noBorders",
            absolutePosition: { x: 68, y: 295 },
            font: "Bree"
            //with borders
            // absolutePosition: { x: 66, y: 300 }
          }
    ];
    docArr.push(content);
  }

  var background = [
    program === "progA" && {
      image:
        "data:image/png;base64,",
      fit: [842, 842]
    }
  ];

  var documentDefinition = {
    pageSize: "A4",
    pageMargins: [0, 0, 0, 0],
    pageOrientation: "landscape",
    content: docArr,
    styles: {
      date: { fontSize: 19 },
      name: { fontSize: 45 }
    },
    background: background
  };

  const pdfDoc = pdfMake.createPdf(documentDefinition);
  pdfDoc.getBase64(data => {
    res.writeHead(200, {
      "Content-Type": "application/pdf",
      "Content-Disposition": `attachment;filename="TelebortCert.pdf"`
    });

    const download = Buffer.from(data.toString("utf-8"), "base64");
    res.end(download);
  });
});

module.exports = router;
